window.bookSummaryJSON = "<p><b>From the world of&nbsp;</b><b><i>Avatar: The Last Airbender</i></b><b>&nbsp;comes a YA novel starring Avatar Kyoshi.</b></p> <p>After years of searching for the next Avatar, the four nations have found peace with Avatar Yun - until Kyoshi, Yun’s friend and servant, demonstrates remarkable bending abilities herself. With the identity of the true Avatar at stake, Kyoshi and her fiery friend Rangi flee the Avatar mansion and find supporters in the daofei - outlaws living in the shadows of the Earth Kingdom. But while Kyoshi, Rangi, and their daofei friends face off against underworld rivals, those who seek to control the Avatar draw close.</p> <p>This thrilling first installment maps Kyoshi’s journey from a girl of humble origins to the merciless pursuer of justice destined to become a legend in the world of&nbsp;<i>Avatar</i>.</p>"; 
